import { ArrowDownIcon } from '@heroicons/react/solid';

const Home = () => {
    return (
        <main className="py-6">
            <div className="flex justify-end">
                <button
                    // onClick={() => setShowCreatePlayerModal(true)}
                    className="transition duration-300 border border-mpblue text-mpblue py-1 px-3 mb-4  hover:text-white hover:bg-mpblue"
                >
                    Create Season
                </button>
            </div>
            <div className="flex flex-col items-center justify-center h-96">
                <p className="text-3xl font-bold">Home Page, what to add?</p>
                <p className="mt-8">
                    <ArrowDownIcon className="inline h-8 mx-1 rotate-180 sm:rotate-135 text-mpred" />
                    Click links at top
                </p>
            </div>

        </main>
    )
}

export default Home;
